if (source == null) {
	secureRandomInstance.nextBytes(new byte[1]);
}
else {
	byte[] seed = FileCopyUtils.copyToByteArray(source.getInputStream());
	secureRandomInstance.setSeed(seed);
}


// The source is assigned to a local variable, so that it 
// cannot be null. 
Resource source = this.source; 
if (source != null) {
	InputStream inputStream = source.getInputStream();
	secureRandomInstance.setSeed(FileCopyUtils.copyToByteArray(inputStream));
}

if (source == null) {
	secureRandomInstance.nextBytes(new byte[1]);
}
else {
	InputStream inputStream = source.getInputStream();
	try {
		secureRandomInstance.setSeed(FileCopyUtils.copyToByteArray(inputStream));
	} finally {
		inputStream.close();
	}
}

